import React from 'react';
import Box from '@material-ui/core/Box';
import Container from '@material-ui/core/Container';
import './css/About.css';
import Typography from '@material-ui/core/Typography';
import {withStyles, createStyles} from '@material-ui/styles';
import StyledProps from './StyledProps';
import {Link} from 'react-router-dom';
import EmailIcon from '@material-ui/icons/Email';
import LinkedinIcon from '@material-ui/icons/LinkedIn';
import FacebookIcon from '@material-ui/icons/Facebook';
import CopyrightRoundedIcon from '@material-ui/icons/CopyrightRounded';

const Contact = (props: StyledProps) => {
  const classes = props.classes;
  return (   
    <Box className={classes.footer}>
      <Box display={'flex'}>
        <Container maxWidth ="lg" className={classes.contact}>
          <Box display={'block'}>
            <Box className={classes.contactBox}>
              <Link to="/" className={classes.text}>About</Link>
            </Box>
            <Box className={classes.contactBox}>
              <Link to="/projects" className={classes.text}>Projects</Link>
            </Box>
          </Box>
        </Container>
        <Container maxWidth="lg" className={classes.contact}>
          <Box display={'block'}>
            <Box className={classes.contactBox}>
              <EmailIcon fontSize={'large'} className={classes.icon}/>
              <Typography className={classes.text}>Email</Typography>
            </Box>
            <Box className={classes.contactBox}>
              <LinkedinIcon fontSize={'large'} className={classes.icon}/>
              <Typography className={classes.text}>Linkedin</Typography>
            </Box>
            <Box className={classes.contactBox}>
              <FacebookIcon fontSize={'large'} className={classes.icon}/>
              <Typography className={classes.text}>Facebook</Typography>
            </Box>
          </Box>
        </Container>
      </Box>
      <Container maxWidth="lg" className={classes.copyRightContainer}>
          <Typography className={classes.subText}>
            <CopyrightRoundedIcon fontSize="inherit"/>
            2020 Nathanael Shim
          </Typography>
      </Container>
    </Box> 
  );
}

const useStyles = createStyles({
  contact: {
    display: 'flex',
    flexDirection: 'column',
    justifyContent: 'space-between',
    alignItems: 'center',
    padding: '.5rem 0',
  },
  footer: {
    backgroundColor: '#8F8073',
  },
  contactTitle: {
    fontFamily: 'Montserrat',
    color: '#12130F',
    fontSize: '3rem',
  },
  text: {
    fontFamily: 'Montserrat',
    color: '#F7F3F2',
    fontSize: '2rem',
    paddingTop: '.3rem',
    paddingLeft: '.5rem',
  },
  subText: {
    fontFamily: 'Montserrat',
    color: '#F7F3F2',
    fontSize: '1rem',
  },
  contactBox: {
    display: 'flex',
    flexDirection: 'row',
    padding: '1rem',
  },
  icon: {
    color: '#F7F3F2',
    padding: '.5rem',
  },
  copyRightContainer: {
    alignItems: 'center',
    display: 'flex',
    justifyContent: 'center',
    padding: '0.5rem',
  }
});

export default withStyles(useStyles)(Contact);
